import { Integration } from 'discord.js';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Card(){
    return(
        <div className="card">
        <div className="cards">
            <img src="" alt="mypic" className="card_img"/>
            <div className="card__info">
                <h3 className="card_titel"></h3>
                <span className="card_txt"></span>
                <a href="#" target="_blank" className="card_btn"><button className="btn">Read More</button></a>
            </div>
        </div>
    </div>
    )
}

ReactDOM.render(
    <>
    <h1> Welcome to a demonstation of a React App</h1>
    <div className="card_container">
        <Card isc="https://source.unsplash.com/200x150/?nature"
        titel="Enjoy!"
        txt="Contrary to popular belief, Lorem Ipsum is not sirem Ipsum passag"/>
        <Card/>
        <Card/>
    </div>
    </>,
    document.getElementById('root')
);
